import { FolderTree, MoveTo } from '@/api/extend/document'
export default {
  data() {
    return {
      visible: false,
      id: '',
      toId: '',
      defaultProps: {
        children: 'children',
        label: 'fullName'
      },
      treeData: []
    }
  },
  methods: {
    init(id, parentId) {
      if (!id) return
      this.id = id
      this.toId = parentId != '0' ? parentId : "-1"
      this.visible = true
      this.$nextTick(() => {
        FolderTree(id).then(res => {
          this.treeData = res.data.list
          this.$nextTick(() => {
            this.$refs.treeBox.setCurrentKey(this.toId);
          })
        })
      })
    },
    handleNodeClick(data) {
      if (this.toId == data.id) return
      this.toId = data.id
    },
    dataFormSubmit() {
      let toId = this.toId == '-1' ? '0' : this.toId
      MoveTo(this.id, toId).then((res) => {
        this.$message({
          message: res.msg,
          type: 'success',
          duration: 1500,
          onClose: () => {
            this.visible = false
            this.$emit('refresh')
          }
        })
      })
    }
  }
}
